// Saves options to chrome.storage
function saveOptions() {
    let warningCBox = document.getElementById('warningCBox').checked;
    let retypingCBox = document.getElementById('retypingCBox').checked;
    let tutorialsCBox = document.getElementById('tutorialsCBox').checked;
    chrome.storage.local.set({
        warningCBox: warningCBox,
        retypingCBox: retypingCBox,
        tutorialsCBox: tutorialsCBox,
    }, function () {
        // Update status to let user know options were saved.
        let status = document.getElementById('status');
        if (status) {
            status.textContent = 'Options saved.';
            setTimeout(function () {
                if (status)
                    status.textContent = '';
            }, 750);
        }
    });
}
// Restores select box and checkbox state using the preferences
// stored in chrome.storage.
function restoreOptions() {
    // Use default value color = 'red' and likesColor = true.
    chrome.storage.local.get({
        warningCBox: true,
        retypingCBox: true,
        tutorialsCBox: true,
    }, function (items) {
        document.getElementById('warningCBox').checked = items.warningCBox;
        document.getElementById('retypingCBox').checked = items.retypingCBox;
        document.getElementById('tutorialsCBox').checked = items.tutorialsCBox;
    });
}
